import React from 'react';
import '../styles/main.css';
import '../styles/buttons.css';

export default function NeonButton({
  children,
  onClick,
  fullWidth = false,
  danger = false,
  className = '',
}) {
  const classes = [
    'neon-button',
    fullWidth ? 'fullWidth' : '',
    danger ? 'danger-button' : '',
    className
  ].filter(Boolean).join(' ');

  return (
    <button
      className={classes}
      onClick={onClick}
    >
      {children}
    </button>
  );
}
